import React, {Component} from 'react';
import "./assets/css/style.css"
import StartAnimation from "./components/animateComponent/StartAnimation";


class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            pressed: false,
            hello: <h1>NOT Pressed</h1>
        }
    }

    changeDiv(){
        this.state.setState({
            pressed: true,
            hello: <h1>Pressed</h1>
        })
    }

    render() {
        return (
            <div className="test">
                <button>
                    HELLO
                </button>
                {this.state.hello}
            </div>
        );
    }


}
export default App;

